import React from 'react';

class NavigationBar extends React.Component {

    onInfoIconSelect = () => {
        this.props.callAPI();
    };

    render() {
        return (
            <div onClick={this.onInfoIconSelect}>
                <i class="big info circle icon"  style={{padding: "18px 0px 0px 0px"}}/>
            </div>
        );
    }
}

export default NavigationBar;
